import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class CarListService {

  constructor(private http: HttpClient) { }

  getCarList() {
    return this.http.get('https://gta.vercel.app/api/vehicles/names');
  }
}
